import React from "react";
import Heading from "./Heading"
import Footer from "./Footer"
import Note from "./Note"
import notes from "../notes"

function App() {
    return <div>
        <Heading />
        <Footer />
        {notes.map(note => {
            return (
                <Note 
                    key = {note.key}
                    title = {note.title}
                    content = {note.content}
                />
            )
        })}
    </div>
};

export default App;
